import React from 'react';
import classes from './allPosts.module.css'
const allPosts = () => {
    return(
        <div>
            <img src= 'https://lh3.googleusercontent.com/proxy/m8QSXY-EaRXr4toNeSNBSTzqPaY8z_Js1LO1gMVxI_44pGXmmUnLoo7-uSKy50QyFq-R-M_rRAY2lYaVc00CIo9EPexaeIRe9vGNQkShI1tQQwfoukJD7PWLEg' className = {classes.avatar}></img>
        </div>
    )
}
export default allPosts;
